/*Table structure for table `tb_naire` */

DROP TABLE IF EXISTS `tb_naire`;

CREATE TABLE `tb_naire` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `title` varchar(50) NOT NULL COMMENT '问卷标题',
  `naire_desc` varchar(300) NOT NULL COMMENT '问卷描述',
  `create_time` date NOT NULL COMMENT '创建日期',
  `end_time` date NOT NULL COMMENT '结束日期',
  `collect_count` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '收集数量统计',
  `user_id` bigint(20) NOT NULL COMMENT '所属用户',
  `category_id` tinyint(4) NOT NULL COMMENT '所属分类',
  `citations_count` bigint(4) unsigned NOT NULL DEFAULT '0' COMMENT '引用次数(默认为0)',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态：1(未发布) 2(收集中) 3(已结束)',
  `del_flag` tinyint(4) NOT NULL DEFAULT '0' COMMENT '删除标记：0(未删除) 1(已删除)',
  `share` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否共享（1：共享 0：不共享）',
  `subject` tinyint(4) NOT NULL DEFAULT '0' COMMENT '主题（0：白色 1：灰色 2：红色 3；黑色）',
  `phone_style` tinyint(4) NOT NULL DEFAULT '0' COMMENT '手机样式（0:beach, 1:city, 2:office）',
  `password` varchar(10) DEFAULT NULL COMMENT '访问密码',
  PRIMARY KEY (`id`),
  KEY `fk_naire_category` (`category_id`),
  KEY `fk_user` (`user_id`),
  CONSTRAINT `fk_naire_category` FOREIGN KEY (`category_id`) REFERENCES `tb_naire_category` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `fk_user` FOREIGN KEY (`user_id`) REFERENCES `tb_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=134 DEFAULT CHARSET=utf8 COMMENT='问卷信息表';

