insert  into `tb_naire_category`(`id`,`category_desc`,`category_brief`,`parent_id`) values (1,'问卷',NULL,0),(2,'品牌营销','品牌资产是以品牌名字为核心的，能够增加或减少企业所销售产品或服务的价值的一系列资产与负债。品牌资产管理的好坏将直接影响到企业的效益，一方面定期地考察品牌健康度，另一方面对品牌营销活动，如广告投放和公关活动等进行效果评估都是非常有必要的。',1),(3,'产品测试','通常新产品从构想、研发到投入市场将经历一系列的测试过程，具体包括：产品名称测试、产品概念测试、口味测试、包装测试和价格测试等。这些相关测试将为产品研发设计和营销策略制定提供非常重要的依据。',1),(4,'消费者分析','消费者分析是市场研究的第一步，它对市场细分、产品研发以及营销策略的制定起到了关键的影响。消费者分析通常包含购买动机、需求、购买行为习惯、使用态度以及媒体接触习惯等内容。',1),(5,'满意度调查','满意度调查是企业改善产品与服务质量、完善管理、提高企业竞争力的必要手段。满意度调查主要分为客户满意度和员工满意度调查两方面。客户满意度调查重点在于发现影响客户满意度的关键因素，从而制定有效的改善措施；而员工满意度调查旨在改善企业内部环境，创建有效的激励方式，提高员工的工作积极性。',1),(6,'人力资源','人力资源管理，指根据企业发展战略的要求，有计划地对人力资源进行合理配置，通常包含员工的招聘、培训、使用、考核、激励、调整等一系列过程。人力资源管理涉及的调查通常有：员工培训需求、员工绩效考核、领导力360度评价、员工满意度、职业倦怠和工作丰富化诊断等内容。',1),(7,'学术教育','学术/教育调查，泛指与专门学科领域、学生群体以及教育有关的调查。从学生群体看，这类调查通常包含早教市场、青少年教育问题，如早恋、上网行为习惯、家庭教育观等，大学生群体学习行为、人际关系、性格特征、网络使用习惯、消费观和职业观等内容。',1),(8,'社会民意','民意调查，又称为舆论调查，是了解公众舆论倾向的一种社会调查。广义的民意调查包括：经济、政治、社会生活等几乎所有领域中对民众意见的调查。狭义的理解：除了市场调查以外的主要针对政治生活和社会生活领域的民意调查。',1),(9,'其它',NULL,1),(10,'表单',NULL,0),(11,'报名','报名表，帮助用户实时、快捷处理各类活动的报名事项，收集处理报名者信息，目前已包含一些聚会、课程、比赛等活动的报名表单模板',10),(12,'登记','登记表，帮助用户实时、快捷的处理各类活动的登记事项，收集处理登记信息，目前已包含一些会议、课程、面试等活动的在线签到、申请和预约登记表单模板',10),(13,'邀请','邀请表，帮助用户在线处理各类活动的邀请工作，收集处理邀请信息，现有派对、培训、会议等邀请表单模板',10),(14,'反馈','反馈表，帮助企业在线收集处理用户使用产品服务时发现的问题和感受建议，目前已包含网站app、课程培训等反馈模板',10),(15,'订单','订单表，帮助用户实时、快捷地处理销售、采购等工作 ，目前已包含食品、日用品、衣物、电子产品等多种类别订单模板',10),(16,'记事','记事表，帮助用户实时、快捷的记录各种事项，管理个人或单位事务，主要包含一些会议、课程、工作的在线记录表单模板',10),(17,'其它',NULL,10),(18,'评测',NULL,0),(19,'培训考评','用问卷网制作在线考评表，检验培训效果。适合员工入职培训，安全培训，专业技能培训等。',18),(20,'教学测试','问卷网是多媒体教学的好帮手，可制作一份图文并茂的测验问卷，还可自动计算得分。适合中小学测验、语文测验、英语测验等。',18),(21,'员工考核','用问卷网制作在线考核表可自动计算得分，帮助企业高效管理员工考核。适合招聘考试、员工安全考试、员工转正考核、职业技能考核等。',18),(22,'趣味测试','问卷网可编写图文并茂的趣味小测试，完善的社交分享功能，让你的小测试火遍微博、微信。',18),(23,'心理测试','在问卷网可灵活设置评分规则，结果评语。可用于制作专业的心理测试、智商测试。',18),(24,'答题闯关',NULL,18),(25,'你多懂我',NULL,18);

/*Table structure for table `tb_option` */

DROP TABLE IF EXISTS `tb_option`;

CREATE TABLE `tb_option` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `option_desc` varchar(100) NOT NULL COMMENT '选项描述',
  `question_id` bigint(20) NOT NULL COMMENT '所属问题',
  PRIMARY KEY (`id`),
  KEY `fk_question` (`question_id`),
  CONSTRAINT `fk_question` FOREIGN KEY (`question_id`) REFERENCES `tb_question` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2427 DEFAULT CHARSET=utf8 COMMENT='选项信息表';

