/*Table structure for table `tb_question` */

DROP TABLE IF EXISTS `tb_question`;

CREATE TABLE `tb_question` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `question_desc` varchar(300) NOT NULL COMMENT '问题描述',
  `naire_id` bigint(20) NOT NULL COMMENT '所属问卷',
  `category_id` tinyint(4) NOT NULL COMMENT '所属类别',
  `order_number` int(11) NOT NULL COMMENT '题目顺序',
  PRIMARY KEY (`id`),
  KEY `fk_question_category` (`category_id`),
  KEY `fk_naire` (`naire_id`),
  CONSTRAINT `fk_naire` FOREIGN KEY (`naire_id`) REFERENCES `tb_naire` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_question_category` FOREIGN KEY (`category_id`) REFERENCES `tb_question_category` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=824 DEFAULT CHARSET=utf8 COMMENT='问题信息表';

