/*Table structure for table `tb_question_category` */

DROP TABLE IF EXISTS `tb_question_category`;

CREATE TABLE `tb_question_category` (
  `id` tinyint(4) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `category_desc` varchar(10) NOT NULL COMMENT '问题类型描述',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='问题分类信息表';

