/*Table structure for table `tb_respondent_info` */

DROP TABLE IF EXISTS `tb_respondent_info`;

CREATE TABLE `tb_respondent_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `start_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '答题开始时间',
  `end_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '答题结束时间',
  `duration` varchar(10) NOT NULL COMMENT '答题时长',
  `browser` varchar(30) NOT NULL COMMENT '答题者浏览器信息',
  `system` varchar(10) NOT NULL COMMENT '答题者操作系统',
  `ip` varchar(15) NOT NULL COMMENT '答题者IP地址',
  `province_id` int(11) NOT NULL COMMENT '答题者所在省（市）ID',
  `naire_id` bigint(20) NOT NULL COMMENT '答题者所回答的问卷ID',
  PRIMARY KEY (`id`),
  KEY `fk_respondent_naire_id` (`naire_id`),
  KEY `fk_respondent_province_id` (`province_id`),
  CONSTRAINT `fk_respondent_naire_id` FOREIGN KEY (`naire_id`) REFERENCES `tb_naire` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_respondent_province_id` FOREIGN KEY (`province_id`) REFERENCES `tb_province` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=529 DEFAULT CHARSET=utf8 COMMENT='答题者信息记录表';

